import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      nfts: [],
    };
  }

  render() {
    return (
      <div className='App'>
        {this.state.nfts.map((nft) => {
          return (
            <div key={nft.id}>
              <h1>{nft.name}</h1>
            </div>
          );
        })}
      </div>
    );
  }
}

export default App;
